import base64
import numpy as np
import cv2
from utils import preprocess_and_generate_embedding, save_embedding

def register_student_from_base64(image_b64):
    student_id = input("Enter the student ID for registration: ")
    print(f"Processing base64 image for student {student_id}...")

    try:
        # Decode the base64 image to a numpy array
        image_data = base64.b64decode(image_b64)
        np_arr = np.frombuffer(image_data, np.uint8)
        frame = cv2.imdecode(np_arr, cv2.IMREAD_COLOR)
        
        # Generate embedding from the decoded frame
        embedding = preprocess_and_generate_embedding(frame)
        if embedding is not None:
            print(f"Generated Embedding: {embedding[:10]}...")  # Show first 10 values for brevity
            save_embedding(embedding, student_id, 'final')
            print(f"Registration completed for student {student_id}.")
        else:
            print("Face not detected in the provided image. Registration aborted.")
    except Exception as e:
        print(f"Error processing base64 image: {e}")

if __name__ == "__main__":
    example_base64_image = "" 
    register_student_from_base64(example_base64_image)
